#
# TABLE STRUCTURE FOR: AGENCIA
#

DROP TABLE IF EXISTS `AGENCIA`;

CREATE TABLE `AGENCIA` (
  `COD_AGENCIA` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_CLIENTE` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `FECHA_INICIO_RELACIONES` date NOT NULL,
  `PAIS_ORIGEN` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ES_VIRTUAL` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `VALORACION` decimal(2,0) NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`COD_AGENCIA`),
  UNIQUE KEY `ID_CLIENTE` (`ID_CLIENTE`),
  CONSTRAINT `AGENCIA_ibfk_1` FOREIGN KEY (`ID_CLIENTE`) REFERENCES `CLIENTE` (`ID_CLIENTE`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: APARTAMENTO
#

DROP TABLE IF EXISTS `APARTAMENTO`;

CREATE TABLE `APARTAMENTO` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_SALON` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `COCINA_ELECTRICA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_PLANTAS` decimal(2,0) NOT NULL,
  `TIENE_ASCENSOR` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_HABITACIONES` int(1) NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  CONSTRAINT `APARTAMENTO_ibfk_1` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO_HOSPEDAJE` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: CLIENTE
#

DROP TABLE IF EXISTS `CLIENTE`;

CREATE TABLE `CLIENTE` (
  `ID_CLIENTE` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `FECHA_PRIMER_CONTRATO` date NOT NULL,
  `ES_CLIENTE_VIP` enum('Sí','No') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_CLIENTE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: CLIENTE_RESERVA_ESP_HOSPEDAJE
#

DROP TABLE IF EXISTS `CLIENTE_RESERVA_ESP_HOSPEDAJE`;

CREATE TABLE `CLIENTE_RESERVA_ESP_HOSPEDAJE` (
  `ID_RESERVA` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_CLIENTE` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `FECHA_RESERVA` date NOT NULL,
  `FECHA_ENTRADA` date NOT NULL,
  `FECHA_SALIDA` date NOT NULL,
  `PRECIO` decimal(8,2) unsigned DEFAULT NULL,
  `PORC_DESCUENTO` decimal(2,0) DEFAULT NULL,
  PRIMARY KEY (`ID_RESERVA`),
  UNIQUE KEY `ID_CLIENTE` (`ID_CLIENTE`),
  UNIQUE KEY `ID_ESPACIO` (`ID_ESPACIO`),
  UNIQUE KEY `FECHA_ENTRADA` (`FECHA_ENTRADA`),
  CONSTRAINT `CLIENTE_RESERVA_ESP_HOSPEDAJE_ibfk_1` FOREIGN KEY (`ID_CLIENTE`) REFERENCES `CLIENTE` (`ID_CLIENTE`) ON DELETE CASCADE,
  CONSTRAINT `CLIENTE_RESERVA_ESP_HOSPEDAJE_ibfk_2` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO_HOSPEDAJE` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: EMPRESA
#

DROP TABLE IF EXISTS `EMPRESA`;

CREATE TABLE `EMPRESA` (
  `CIF` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_CLIENTE` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_EMPLEADOS` decimal(4,0) unsigned DEFAULT NULL,
  `ALCANCE` enum('Local','Regional','Nacional','Comunitaria','Multinacional') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIPO_EMPRESA` enum('Limitada','Anónima','Cooperativa','Autónomo') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`CIF`),
  UNIQUE KEY `ID_CLIENTE` (`ID_CLIENTE`),
  CONSTRAINT `EMPRESA_ibfk_1` FOREIGN KEY (`ID_CLIENTE`) REFERENCES `CLIENTE` (`ID_CLIENTE`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: ESPACIO
#

DROP TABLE IF EXISTS `ESPACIO`;

CREATE TABLE `ESPACIO` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `SUPERFICIE` float(6,3) unsigned NOT NULL,
  `ID_HOTEL` varchar(6) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_ESPACIO_CONT` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `TIENE_INTERNET` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_VISTAS` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'No',
  `ESTA_CLIMATIZADO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  KEY `ID_HOTEL` (`ID_HOTEL`),
  KEY `ID_ESPACIO_CONT` (`ID_ESPACIO_CONT`),
  CONSTRAINT `ESPACIO_ibfk_1` FOREIGN KEY (`ID_HOTEL`) REFERENCES `HOTEL` (`ID_HOTEL`) ON DELETE CASCADE,
  CONSTRAINT `ESPACIO_ibfk_2` FOREIGN KEY (`ID_ESPACIO_CONT`) REFERENCES `ESPACIO` (`ID_ESPACIO`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: ESPACIO_HOSPEDAJE
#

DROP TABLE IF EXISTS `ESPACIO_HOSPEDAJE`;

CREATE TABLE `ESPACIO_HOSPEDAJE` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_BANHOS` decimal(2,0) DEFAULT NULL,
  `NUM_CAMAS` decimal(2,0) NOT NULL,
  `TIENE_TERRAZA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ADMITE_FUMADORES` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ADMITE_MASCOTAS` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `CANCELACION_GRATIS` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `MOVILIDAD_ADAPTADA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `PRECIO_NOCHE` decimal(6,1) NOT NULL,
  `LUMINOSIDAD` enum('BAJA','MEDIA','ALTA') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  CONSTRAINT `ESPACIO_HOSPEDAJE_ibfk_1` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: ESPACIO_INSTALACION
#

DROP TABLE IF EXISTS `ESPACIO_INSTALACION`;

CREATE TABLE `ESPACIO_INSTALACION` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `AFORO` decimal(5,0) unsigned DEFAULT NULL,
  `HORARIO_ACCESIBLE` varchar(40) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ES_EXTERIOR` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `USO_INFANTIL` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIPO` enum('Gimnasio','Restaurante','Piscina','Pista de tenis','Pista de pádel','Campo de Golf','Spa') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ESTA_INCLUIDO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `NECESITA_RESERVA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  CONSTRAINT `ESPACIO_INSTALACION_ibfk_1` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: HABITACION
#

DROP TABLE IF EXISTS `HABITACION`;

CREATE TABLE `HABITACION` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIPO` enum('INDIVIDUAL','DOBLE','TRIPLE','CUADRUPLE') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ES_SUITE` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ES_COMPARTIDO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `BANHO_COMPARTIDO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_COCINA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  CONSTRAINT `HABITACION_ibfk_1` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO_HOSPEDAJE` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: HOTEL
#

DROP TABLE IF EXISTS `HOTEL`;

CREATE TABLE `HOTEL` (
  `ID_HOTEL` varchar(6) COLLATE utf8mb4_unicode_ci NOT NULL,
  `CALLE` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `LOCALIDAD` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `PROVINCIA` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ESTRELLAS` decimal(1,0) unsigned NOT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `DISTANCIA_PLAYA` decimal(6,1) DEFAULT NULL,
  `DISTANCIA_CENTRO` decimal(6,1) DEFAULT NULL,
  `PARKING` enum('ABIERTO','CERRADO') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `TRASLADO_AEROPUERTO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `VALORACION` decimal(2,1) NOT NULL,
  `TIPO` enum('HISTORICO','CONCEPTUAL','MODERNO','TRADICIONAL') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_ASCENSOR` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `PRESUPUESTO` decimal(11,2) NOT NULL,
  `INGRESOS` decimal(11,2) NOT NULL,
  `PRES_MARKETING` decimal(11,2) NOT NULL,
  `TIENE_SH` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_HOTEL`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: HUESPED
#

DROP TABLE IF EXISTS `HUESPED`;

CREATE TABLE `HUESPED` (
  `NUM_ID` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_CLIENTE` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `NACIONALIDAD` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_TARJETA` varchar(19) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `FAMILIA_NUMEROSA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ESTADO_CIVIL` enum('Soltero','Casado','Viúdo','Divorciado') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `SITUACION_LABORAL` enum('Empresario','Autónomo','Asalariado','Cooperativista','En paro','Jubilado') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `MEDIO_TRANSPORTE` enum('Coche','Avión','Tren','Moto','Bus','Camión') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `COMO_CONOCISTE` enum('Internet','Publicidad','Conocidos','Otros') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `TRAE_MASCOTA` enum('Sí','No') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `PAIS_RESIDENCIA` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`NUM_ID`),
  UNIQUE KEY `ID_CLIENTE` (`ID_CLIENTE`),
  UNIQUE KEY `NUM_TARJETA` (`NUM_TARJETA`),
  CONSTRAINT `HUESPED_ibfk_1` FOREIGN KEY (`ID_CLIENTE`) REFERENCES `CLIENTE` (`ID_CLIENTE`) ON DELETE SET NULL,
  CONSTRAINT `HUESPED_ibfk_2` FOREIGN KEY (`NUM_ID`) REFERENCES `PERSONA` (`NUM_ID`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: PERSONA
#

DROP TABLE IF EXISTS `PERSONA`;

CREATE TABLE `PERSONA` (
  `NUM_ID` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci NOT NULL,
  `TELEFONO` varchar(31) COLLATE utf8mb4_unicode_ci NOT NULL,
  `FECHA_NACIMIENTO` date DEFAULT NULL,
  `GENERO` enum('Masculino','Femenino','Otro') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`NUM_ID`),
  UNIQUE KEY `TELEFONO` (`TELEFONO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



